import React from "react";
import Slider from "react-slick";
import ava01 from "../../assets/images/ava-1.jpg";
import ava02 from "../../assets/images/ava-2.jpg";
import ava03 from "../../assets/images/ava-3.jpg";

const Testimonials = () => {
  return (
    <Slider>
      <div className="testimonial py-4 px-3">
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Rem numquam dolor quod vitae
          maxime rerum, earum nam quae eligendi reprehenderit ea iusto, autem, illum reiciendis
          deleniti commodi eum esse officiis!
        </p>
      </div>
    </Slider>
  );
};

export default Testimonials;
